import React, { useState, useEffect } from "react";
import styled from "styled-components";

export default function Cart() {
  return (
    <>
      <Nav>
        <span>진희 Nav</span>
      </Nav>
    </>
  );
}

const Nav = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 60px;
  background-color: yellow;
  text-align: center;
  span {
    font-size: 40px;
  }
`;

const Section = styled.section`
  margin: 0 auto;
`;
